INSERT INTO `cms_articlenews`(`Id`, `CategoryId`, `CategoryName`, `Title`, `SubTitle`, `LinkUrl`, `ImgUrl`, `SeoTitle`, `SeoKeywords`, `SeoDescription`, `Tags`, `Zhaiyao`, `Description`, `SortCode`, `IsMsg`, `IsTop`, `IsRed`, `IsHot`, `IsSys`, `IsNew`, `IsSlide`, `Click`, `LikeCount`, `TotalBrowse`, `Source`, `Author`, `EnabledMark`, `DeleteMark`, `CreatorTime`, `CreatorUserId`, `CompanyId`, `DeptId`, `LastModifyTime`, `LastModifyUserId`, `DeleteTime`, `DeleteUserId`) VALUES ('2021010820332927637124', '2021010811282177302429', '升级通知', 'iiioo ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p><img src=\"data:image/png;base64,\"></p><p><strong>在线体验</strong></p><p>Vue版本体验地址：http://netvue.ts.yuebon.com/（用户名：test，密码：test123）</p><p><br></p><p>WebApi接口地址：http://netcoreapi.ts.yuebon.com</p><p><br></p><p>官方文档：http://docs.v.yuebon.com/</p><p><br></p><p>交流QQ群：90311523</p><p><br></p><p>更新日志</p><p>更新日志 点击查看</p><p><br></p><p>概述</p><p>YuebonCore是基于.Net5.0开发的权限管理及快速开发框架，整合应用最新技术包括Asp.NetCore MVC、Dapper、AutoFac、WebAPI、Swagger、EF、Vue等，核心模块包括：组织机构、角色用户、权限授权、多系统、多应用管理、定时任务、业务单据编码规则、代码生成器等。它的架构易于扩展，规范了一套业务实现的代码结构与操作流程，使 YuebonCore框架更易于应用到实际项目开发中。</p><p><br></p><p>YuebonCore FW其核心设计目标是开发迅速、代码量少、学习简单、功能强大、轻量级、易扩展，让Web开发更快速、简单，解决70%重复工作。轻松开发，专注您的业务，从YuebonCore FW开始！</p><p><br></p><p>项目简介</p><p>YuebonCore是一套基于Net5.0 开发出来的框架，源代码完全开源！目前发布了Vue单页面版和mvc版两个版本，开发者可以根据自己的喜好选择。</p><p><br></p><p>使用 MIT 协议，采用主流框架，容易上手，简单易学，学习成本低。可完全实现二次开发、基本满足80%项目需求。</p><p><br></p><p>代码生成器可以帮助解决.NET项目70%的重复工作，让开发更多关注业务逻辑。既能快速提高开发效率，帮助公司节省人力成本，同时又不失灵活性。</p><p><br></p><p>操作权限控制精密细致，对所有管理链接都进行权限验证，可控制到导航菜单、功能按钮。</p><p><br></p><p>数据权限（精细化数据权限控制，可以设置角色可以访问的数据范围，部门、工作组、公司数据）</p><p><br></p><p>常用类封装，日志、缓存、验证、字典、文件、邮件、,Excel。等等，目前兼容浏览器（IE11+、Chrome、Firefox、360浏览器等）</p><p><br></p><p>适用范围：可以开发OA、ERP、BPM、CRM、WMS、TMS、MIS、BI、电商平台后台、物流管理系统、快递管理系统、教务管理系统等各类管理软件。</p><p><br></p><p>技术介绍</p><p>前端目前采用Vue家族前端技术。</p><p><br></p><p>前端技术</p><p>Vue版前端技术栈 ：基于vue、vuex、vue-router 、vue-cli 、axios 和 element-ui，，前端采用vscode工具开发</p>', 99, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, '2021-01-08 20:33:30', '9f2ec079-7d0f-4fe2-90ab-8b09a8302aba', NULL, NULL, '2021-01-08 20:56:14', '9f2ec079-7d0f-4fe2-90ab-8b09a8302aba', NULL, NULL);
